	public static int execute(String input) {
		int numbers[] = getNumbersFromString(input);

		int output = processTestCase(numbers);

		return output;
	}

	private static int[] getNumbersFromString(String input) {
		String[] splits = input.split(" ");
		int[] numbers = new int[splits.length];
		int length = splits.length;
		for (int i = 0; i < length; i++) {
			numbers[i] = Integer.parseInt(splits[i]);
		}
		return numbers;
	}
	
	public static int processTestCase(int[] numbers) {
		int length = numbers.length;
		int lhsAnswer = findMinPrefix(numbers[0], numbers[1], 0);
		
		Window window = new Window(0, 1, length, lhsAnswer, numbers);
		int rhsAnswer = 0;
		
		/*
		 * Until window is full size, keep expanding on RHS
		 */
		for(; !window.fullSize(); ) {
			//Try to extend window to right
			if(!window.extendRight()) {
				
				/*
				 * If true, means find next potential answer on RHS and check on LHS.
				 * If false, means find next potential answer on LHS and check on RHS.
				 */
				boolean checkOnLeftEnd = true;
				boolean bothEndsSatisfied = false;
				
				while(!bothEndsSatisfied) {					
					if(checkOnLeftEnd) {
						rhsAnswer = window.findPotentialAnswerAtRightEnd();
					
						lhsAnswer = rhsAnswer - window.windowLength + 1;
						
						window.startNumber = lhsAnswer;
						
						//Does that work for LHS end of window?
						if(window.checkAtIndex(0)) {
							bothEndsSatisfied = true;
							break;
						}else {
							checkOnLeftEnd = false;
						}
					}else {
						lhsAnswer = window.findPotentialAnswerAtLeftEnd();
						
						rhsAnswer = lhsAnswer + window.windowLength - 1;
						
						window.startNumber = lhsAnswer;
						
						//Does that work for RHS end of window?
						if(window.checkAtIndex(window.end)) {
							bothEndsSatisfied = true;
							break;
						}else {
							checkOnLeftEnd = true;
						}
					}
				}
				
				//Both ends are satisfied, let's do a full check.
				boolean check = window.fullCheck();
				if(!check) {
					//lhsAnswer - next potential one
					lhsAnswer = window.findPotentialAnswerAtLeftEnd();
					window.resize(lhsAnswer);
				}
				
			}
		}

		return window.startNumber;
	}
	
	/**
	 * Find the smallest number N such that N > n
	 * and N contains the digit d.
	 * @param n
	 * @param digit
	 * @return
	 * @throws Exception 
	 */
	public static int findNextOccurenceFlawed(int n, int d) {
		int answer = n + 1, answer1, answer2;
		
		//If answer already contains digit, no further processing is needed
		if(!numberContainsDigit(answer, d)) {
			int u = answer % 10;
			int p = answer / 10;
			int t = p % 10;
			
			if(d > u) {
				answer = p * 10 + d;
			}else if(d < u) {
				answer1 = (p * 10) + 10 + d;
				
				if(t + 1 == d) {
					answer2 = answer - (10 * t) + (10 * d) - u;
					answer = min(answer1, answer2);
				}else {
					answer = answer1;
				}
				
			}else if(d == u) {
				System.out.println("Whoa!");
			}
		}
		
		return answer;
	}
	
	/**
	 * Find the smallest number N such that N > n
	 * and N contains the digit d.
	 * @param n
	 * @param digit
	 * @return
	 * @throws Exception 
	 */
	public static int findNextOccurence(int n, int d) {
		int answer = n + 1;
		
		//If answer already contains digit, no further processing is needed
		if(!numberContainsDigit(answer, d)) {
			int u = answer % 10; //Unit's place
			int p = answer / 10;
			int t = p % 10; //Ten's place
			
			if(d > u) {
				//Answer is in current decade
				answer = answer - u + d;
			}else if(d < u) {
				//Answer is in next decade
				answer = answer - u + 10; //Start of next decade - 0th number
				
				if(!numberContainsDigit(answer, d)) {
					//Check by adjusting last digit of number
					answer = answer + d;  
				}
			}else if(d == u) {
				System.out.println("Whoa!");
			}
		}
		
		return answer;
	}
	
	/**
	 * Find the smallest number N such that N > n
	 * and N contains the digits d and e.
	 * @param n
	 * @param d
	 * @param e
	 * @return
	 * @throws Exception
	 */
	public static int findNextOccurence(int n, int d, int e) {
		int answer = findNextOccurence(n, d);
		boolean checkForE = true, answerFound = false;
		
		for(; !answerFound;) {
			if(checkForE) {
				if(numberContainsDigit(answer, e)) {
					answerFound = true;
				}else {
					answer = findNextOccurence(answer, e);
					checkForE = false;
				}
			}else {
				if(numberContainsDigit(answer, d)) {
					answerFound = true;
				}else {
					answer = findNextOccurence(answer, d);
					checkForE = true;
				}
			}
		}
		
		return answer;
	}
	
	/**
	 * Find the smallest number N such that
	 * N > threshold
	 * and N contains a
	 * and (N + 1) contains b
	 * @param a
	 * @param b
	 * @param threshold
	 * @return
	 */
	public static int findMinPrefix(int a, int b, int threshold) {
		System.out.println("\nFinding min prefix for : a : " + a + " b : " + b + " threshold : " + threshold);
		int i = threshold +1;
		
		boolean aMatch = numberContainsDigit(i, a);
		boolean bMatch = numberContainsDigit(i + 1, b);
		
		while(!(aMatch && bMatch)) {
			if(!aMatch) {
				//i does not contain a.
				System.out.print(i + " doesn't match for a: " + a);
				i = findNextOccurence(i, a);
				System.out.println(" Let's try with " + i);
				aMatch = true;
				bMatch = numberContainsDigit(i + 1, b);
			}else {
				//i + 1 does not contain b
				System.out.print(i + " doesn't match for b: " + b);
				i = findNextOccurence(i + 1, b) - 1;
				System.out.println(" Let's try with " + i);
				bMatch = true;
				aMatch = numberContainsDigit(i, a);
			}
		}
		
		System.out.println("Final answer: " + i + "\n\n");
		return i;
	}
	
	public static int findMinBruteForcePrefix(int a, int b, int threshold) {
		int i = threshold +1;
		for(; ; i++) {
			if(numberContainsDigit(i, a) && numberContainsDigit(i + 1, b) )
				break;
		}
		return i;
	}
	
	private static boolean numberContainsDigit(int number, int digit) {
		return String.valueOf(number).contains(digit + "");
	}
	
	private static int min(int a, int b) {
		return a < b ? a : b;
	}
	
